// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'; // Import BrowserRouter and other necessary components
import Header from './components/Header';
import LoginForm from './containers/HomePage/LoginForm';
import CustomerDashboard from './containers/CustomerDashboard'; // Import CustomerDashboard component

function App() {
  return (
    <Router> {/* Wrap your application with BrowserRouter */}
      <div className="App">
        <Header />
        <Switch> {/* Use Switch to render only one component at a time */}
          <Route path="/customer/dashboard" component={CustomerDashboard} /> {/* Route for the customer dashboard */}
          <Route path="/" exact component={LoginForm} /> {/* Route for the login form */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
